import Comp from "../components/comp";
import { withRouter } from "next/router";
import Link from "next/link";

const A = ({ router, name }) => (
  <Link href="#aaa">
    <a>
      A{router.query.id}&nbsp;{name}
    </a>
  </Link>
);

A.getInitialProps = () => {
  return {
    name: "aaaaaaa"
  };
};
export default withRouter(A);
